import React from "react";
import './App.css';

import Card from "./Components/Card/Card.js";

function App() {
return (
    <div className="container">
        <Card type="box" size="small">
            Some text goes here
        </Card>
        <Card type="box" size="medium">
            Some text goes here
        </Card>
        <Card type="box" size="large">
            Some text goes here
        </Card>
    </div>
);
}

export default App;
